const helloWorld = (state=initialState, action) => {
  switch (action.type) {
	  case HELLO_WORLD:
      return {
      	...state,
	      filter: action.filter
      }
    case FILTER:
	    return {
		    ...state,
		    filter: action.filter
	    }
    default:
      return state
  }
}

const helloReducer = combineReducers({
  helloWorld
})

export default helloReducer
